import img1 from './img/family.png';
import img2 from './img/img01.png';
import img3 from './img/img3.png';
import img4 from './img/img4.png';
import img5 from './img/img5.png';
import img6 from './img/img6.png';
import img7 from './img/img7.png';
import img8 from './img/img011.png';
import img9 from './img/img012.png';
import img10 from './img/maternity.png';


const ImagesAlb = [
    {
        img: img1,
        id: '1',
    },
    {
        img: img2,
        id: '2',
    },
    {
        img: img3,
        id: '3',
    },
    {
        img: img4,
        id: '4',
    },
    {
        img: img5,
        id: '5',
    },
    {
        img: img6,
        id: '6',
    },

    {
        img: img7,
        id: '7',
    },
    {
        img: img8,
        id: '8',
    },
    {
        img: img9,
        id: '9',
    },
    {
        img: img10,
        id: '10',
    },
];
export {ImagesAlb}
